    setvalue(event.target.value);  
  };


    return (
      <div>
         <form >
      <div>
        <label htmlFor="name">{data.title} :</label>
          {data.values?.map(e =><>  <input
              type="radio"
              name={e}
              value={e}
              checked={value === e}
              onChange={handleChange}/>
              <label>
              {e}
            </label>
            </>
             )}


            <button type="submit">Soumettre</button>
            </div>
    </form>

      <input
        type={data.type}
        id={data.key}
        name={data.key}
        // value={formik.values.name}
